{
  "title": "Projects [Table]",
  "type": "computed-columns",
  "params": {
    "perPage": 10,
    "showPartialRows": false,
    "showMeticsAtAllLevels": false,
    "sort": {
      "columnIndex": null,
      "direction": null
    },
    "showTotal": true,
    "totalFunc": "sum",
    "computedColumns": [
      {
        "formula": "col[5] / col[6]",
        "label": "Spent",
        "format": "0,00%",
        "enabled": true
      }
    ]
  },
  "aggs": [
    {
      "id": "4",
      "enabled": true,
      "type": "cardinality",
      "schema": "metric",
      "params": {
        "field": "issueId.keyword",
        "customLabel": "Tickets"
      }
    },
    {
      "id": "1",
      "enabled": true,
      "type": "sum",
      "schema": "metric",
      "params": {
        "field": "hours",
        "customLabel": "Spent hours"
      }
    },
    {
      "id": "2",
      "enabled": true,
      "type": "sum",
      "schema": "metric",
      "params": {
        "field": "moneySpent",
        "customLabel": "Spent euros"
      }
    },
    {
      "id": "5",
      "enabled": true,
      "type": "terms",
      "schema": "bucket",
      "params": {
        "field": "mpsProjectCode.keyword",
        "size": 99,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "Project ID"
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "max",
      "schema": "metric",
      "params": {
        "field": "mpsBudget",
        "customLabel": "Budget"
      }
    },
    {
      "id": "6",
      "enabled": true,
      "type": "terms",
      "schema": "bucket",
      "params": {
        "field": "mpsProjectTitle.keyword",
        "size": 100,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "Project title"
      }
    },
    {
      "id": "7",
      "enabled": true,
      "type": "terms",
      "schema": "bucket",
      "params": {
        "field": "mpsYear.keyword",
        "size": 100,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "mpsYear"
      }
    }
  ],
  "listeners": {}
}

{
  "title": "Spent time by project and product 2017 (bar chart)",
  "type": "histogram",
  "params": {
    "shareYAxis": true,
    "addTooltip": true,
    "addLegend": true,
    "legendPosition": "right",
    "scale": "linear",
    "mode": "stacked",
    "times": [],
    "addTimeMarker": false,
    "defaultYExtents": false,
    "setYExtents": false,
    "yAxis": {}
  },
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "sum",
      "schema": "metric",
      "params": {
        "field": "hours",
        "customLabel": "Spent hours"
      }
    },
    {
      "id": "2",
      "enabled": true,
      "type": "date_range",
      "schema": "segment",
      "params": {
        "field": "spent_on",
        "ranges": [
          {
            "from": "2017-01-01",
            "to": "now"
          }
        ],
        "customLabel": "Spent on"
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "terms",
      "schema": "split",
      "params": {
        "field": "mpsProjectTitle.keyword",
        "size": 20,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "Project Title",
        "row": false
      }
    },
    {
      "id": "4",
      "enabled": true,
      "type": "terms",
      "schema": "group",
      "params": {
        "field": "mpsProductName.keyword",
        "size": 20,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "Product Name"
      }
    }
  ],
  "listeners": {}
}

{
  "title": "Spent time by year and product id (table)",
  "type": "table",
  "params": {
    "perPage": 10,
    "showMeticsAtAllLevels": false,
    "showPartialRows": false,
    "showTotal": false,
    "sort": {
      "columnIndex": null,
      "direction": null
    },
    "totalFunc": "sum"
  },
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "sum",
      "schema": "metric",
      "params": {
        "field": "hours"
      }
    },
    {
      "id": "4",
      "enabled": true,
      "type": "terms",
      "schema": "bucket",
      "params": {
        "field": "mpsProjectCode.keyword",
        "size": 10001,
        "order": "desc",
        "orderBy": "1"
      }
    },
    {
      "id": "2",
      "enabled": true,
      "type": "terms",
      "schema": "bucket",
      "params": {
        "field": "mpsProductName.keyword",
        "size": 1000,
        "order": "desc",
        "orderBy": "1"
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "date_histogram",
      "schema": "split",
      "params": {
        "field": "spent_on",
        "interval": "y",
        "customInterval": "2h",
        "min_doc_count": 1,
        "extended_bounds": {},
        "row": true
      }
    }
  ],
  "listeners": {}
}

{
  "title": "Spent time over time by project code (split line)",
  "type": "line",
  "params": {
    "shareYAxis": true,
    "addTooltip": true,
    "addLegend": true,
    "legendPosition": "right",
    "showCircles": true,
    "smoothLines": true,
    "interpolate": "linear",
    "scale": "linear",
    "drawLinesBetweenPoints": true,
    "radiusRatio": 9,
    "times": [],
    "addTimeMarker": false,
    "defaultYExtents": false,
    "setYExtents": false,
    "yAxis": {},
    "orderBucketsBySum": false
  },
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "sum",
      "schema": "metric",
      "params": {
        "field": "hours"
      }
    },
    {
      "id": "2",
      "enabled": true,
      "type": "date_histogram",
      "schema": "segment",
      "params": {
        "field": "created_on",
        "interval": "M",
        "customInterval": "2h",
        "min_doc_count": 1,
        "extended_bounds": {}
      }
    },
    {
      "id": "3",
      "enabled": true,
      "type": "terms",
      "schema": "split",
      "params": {
        "field": "mpsProjectCode.keyword",
        "size": 8,
        "order": "desc",
        "orderBy": "1",
        "row": true
      }
    }
  ],
  "listeners": {}
}

{
  "title": "% of project budget spent",
  "type": "histogram",
  "params": {
    "shareYAxis": true,
    "addTooltip": true,
    "addLegend": true,
    "legendPosition": "right",
    "scale": "linear",
    "mode": "stacked",
    "times": [],
    "addTimeMarker": false,
    "defaultYExtents": false,
    "setYExtents": true,
    "yAxis": {
      "max": 1.1,
      "min": 0
    },
    "orderBucketsBySum": false
  },
  "aggs": [
    {
      "id": "1",
      "enabled": true,
      "type": "sum",
      "schema": "metric",
      "params": {
        "field": "sc-share-of-total-project-budget",
        "customLabel": "% of project budget spent"
      }
    },
    {
      "id": "2",
      "enabled": true,
      "type": "terms",
      "schema": "segment",
      "params": {
        "field": "mpsProjectCode.keyword",
        "size": 20,
        "order": "desc",
        "orderBy": "1",
        "customLabel": "MPS Project code"
      }
    }
  ],
  "listeners": {}
}

